import React from 'react';
import logo from './logo.svg';
import './App.css';
// Route를 먼저 불러와줍니다.
import { Routes, Route, BrowserRouter } from "react-router-dom";

import SchedulePage from "./components/SchedulePage";
import EnterScheduleInformation from "./components/EnterScheduleInformation";
import ExpenseCalculationAndSupplies from "./components/ExpenseCalculationAndSupplies";
import PlannerWeather from "./components/PlannerWeather";
import Transport from "./components/Transport";
import ScheduleItem from "./components/ScheduleItem";

class App extends React.Component{
  constructor(props){
    super(props);
    this.state={};
  }

  render(){

    return (
      <div>
        <BrowserRouter>
          <Routes>
            <Route path="/main" exact component={SchedulePage} />
            <Route path="/cal" exact component={ExpenseCalculationAndSupplies} />
          </Routes>
        </BrowserRouter>

        <SchedulePage>

        </SchedulePage>
      </div>
    );
  }
}

export default App;
